import{_ as e,o as i,c as t,O as r}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 30-150 Authority for minor changes to the Virginia Administrative Code.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/30-150.md","filePath":"vacode/30-150.md"}'),o={name:"vacode/30-150.md"},a=r('<h1 id="§-30-150-authority-for-minor-changes-to-the-virginia-administrative-code" tabindex="-1">§ 30-150 Authority for minor changes to the Virginia Administrative Code. <a class="header-anchor" href="#§-30-150-authority-for-minor-changes-to-the-virginia-administrative-code" aria-label="Permalink to &quot;§ 30-150 Authority for minor changes to the Virginia Administrative Code.&quot;">​</a></h1><p>The Commission may correct unmistakable printer&#39;s errors, misspellings and other unmistakable errors in the regulations as incorporated into the Virginia Administrative Code, and may make consequential changes in the titles of officers and agencies, and other purely consequential changes made necessary by the use in the regulations of titles, terminology and references, or other language no longer appropriate.</p><p>The Commission may renumber, rename and rearrange any Virginia Administrative Code titles, sections or other divisions within the regulations which have been proposed, adopted or have become effective and make corresponding changes in lists of subject and section headings, catchlines and tables, when in the judgment of the Commission it is necessary because of any disturbance or interruption of orderly or consecutive arrangement.</p><p>The Commission may correct unmistakable errors in the cross-references to Code of Virginia or Virginia Administrative Code sections and may change cross-references to such sections which have become outdated or incorrect due to subsequent amendment to, revision or repeal of the sections to which reference is made.</p><p>The Commission may omit from the regulations incorporated into the Virginia Administrative Code provisions which, in the judgment of the Commission, are inappropriate in a code, including, but not limited to, (i) effective date clauses and (ii) severability clauses, which are provided for under § <a href="http://law.lis.virginia.gov/vacode/2.2-4004/" target="_blank" rel="noreferrer">2.2-4004</a>.</p><p>1993, c. 669, § 9-77.10:1; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0844" target="_blank" rel="noreferrer">844</a>.</p>',6),n=[a];function s(c,d,h,m,l,g){return i(),t("div",null,n)}const f=e(o,[["render",s]]);export{u as __pageData,f as default};
